func getDomainResolver(from, name string, coinType *big.Int) string {
	fromAddr := crypto.AddressFromB58String(from)
	resolverAddr := evmutils.AddressToAddressCoin(common.HexToAddress(config.PUBLIC_RESOLVER_ADDR).Bytes())
	resolverAbi, _ := abi.JSON(strings.NewReader(RESOLVER_ABI))
	node := evmutils.NameHash(name)
	input, _ := resolverAbi.Pack("addr", node, coinType)
	vmRun := evm.NewVmRun(fromAddr, resolverAddr, []byte("0x1"), nil)
	result, _, err := vmRun.Run(input, 9000000, 1, 0, false)
	if err != nil {
		return ""
	}
	out, err := resolverAbi.Unpack("addr", result.ResultData)
	if err != nil {
		return ""
	}
	out0 := *abi.ConvertType(out[0], new([]byte)).(*[]byte)

	return string(out0)
	//return common.Bytes2Hex(out0)
}

func CheckDomainResolve(from, name, dst string, coinType *big.Int) bool {
	if coinType.Uint64() > 10 {
		return false
	}

	res := getDomainResolver(from, name, coinType)
	if res == "" {
		return false
	}

	return res == dst
}

const REGISTER_ID = "d393c871"

var RegisterRecordCache *RegisterRecord

type RegisterRecord struct {
	method string
	abi    abi.ABI
	mm     map[string]struct{}
}

func GetEnsRegisterRecord() *RegisterRecord {
	if RegisterRecordCache == nil {
		abiObj, err := abi.JSON(strings.NewReader(REGISTRAR_ABI))
		if err != nil {
			return nil
		}

		RegisterRecordCache = &RegisterRecord{
			"register",
			abiObj,
			make(map[string]struct{}),
		}
	}
	return RegisterRecordCache
}

func (rr *RegisterRecord) FilterRegister(payload []byte) bool {
	inputs, err := rr.abi.Methods[rr.method].Inputs.Unpack(payload[4:])
	if err != nil {
		return false
	}

	n := *abi.ConvertType(inputs[0], new(string)).(*string)

	if _, ok := rr.mm[n]; ok {
		return false
	}

	rr.mm[n] = struct{}{}
	return true
}

func (rr *RegisterRecord) GetRegisterName(payload []byte) string {
	inputs, err := rr.abi.Methods[rr.method].Inputs.Unpack(payload[4:])
	if err != nil {
		return ""
	}

	return *abi.ConvertType(inputs[0], new(string)).(*string)
}

func (rr *RegisterRecord) Clean() {
	rr.mm = make(map[string]struct{})
}

